import React from 'react'
import notificationsImg from '../../../assets/defaultImg/premium-icon-notification-3239952.png'
function Notifications(props) {
  return (
    <div className='notifications_block'>
      <img src={notificationsImg} alt='err' />
    </div>
  )
}

export default Notifications
